import React, { useEffect } from 'react';
import axios from 'axios';
import './App.css';

const App = () => {

  useEffect(() => {
    axios.get(`${process.env.REACT_APP_API}/jStations?L&api_key=${process.env.REACT_APP_SECRET}`)
      .then((data) => console.log(data));
  }, [])

  return (
    <div className="App">
      <p>hello world</p>
    </div>
  );
}

export default App;
